$(document).ready(function() {

    /* poopin up */
    $("#mail-list").on("click",function() {
        if($('#popi').is(":hidden")){
            $('#popi').show();
            $('#screen').show();
        }else
        $.get('/newsletter', function(data){
            $('#popi').html(data);
            $('#popi').fadeIn();
        });
        $('#popi').addClass ("pppp");
    });

    var slider = $('#slider').leanSlider({
        directionNav: '#slider-direction-nav',
        controlNav: '#slider-control-nav'
    });
});
(function() {
  var ready;

  ready = function() {
    return $('#pull').on('click', (function(_this) {
      return function() {
        var menu, pull;
        pull = $('#pull');
        menu = $('nav ul');
        return menu.slideToggle();
      };
    })(this));
  };

  $(document).ready(ready);

  $(document).on('page:load', ready);

}).call(this);
